import React from "react";
import styled from 'styled-components';

const d = new Date();
let year = d.getFullYear();

const Footer = () => {

    return (
        <FooterContainer>
            <SocialmediaContainer>
                <p>Instagram</p>
            </SocialmediaContainer>
            <AddressContainer>
                <ul>
                    <li>48 Kijabe street, Nairobi</li>
                    <li>Phone: +254 714 687727</li>
                    <li></li>
                    <li></li>
                </ul>
            </AddressContainer>
            <QuicklinksContainer>
                <ul>
                    <li></li>
                    <li>Contact</li>
                    <li>Our products</li>
                    <li></li>
                </ul>
            </QuicklinksContainer>
            <p>Frostfield Tech Copyright &copy {year}</p>

        </FooterContainer>
    )
};

const FooterContainer = styled.div`

display:flex;
flex-direction: row;
justify-content: space-between;
padding: 20px 200px;

ul {
    list-style-type: none;
}


background-color: #2da95c;
height: 300px;
width: 100vw;
color: #white;
font-size: 40px;
font-weight: 300;
line-height: 40px;
font-color: rgb(109, 109, 109);

`
const SocialmediaContainer = styled.div`
margin: 20px 30px; 
min-height: 150px;


p{
    font-family: 'Allura', cursive;
}`
const AddressContainer = styled.div`
margin: 20px 30px; 
min-height: 150px;
`
const QuicklinksContainer = styled.div`
margin: 20px 30px; 
min-height: 150px;
`

export default Footer;
